backend.tf.code:
terraform {
  backend "s3" {
    bucket = "cloud-ai-demo-infra"
    key    = "cloud-ai/terraform.tfstate"
    region = "us-east-1"
    # Optionally add encryption
    encrypt = false
    # Optionally enable DynamoDB for state locking
    # dynamodb_table = "my-lock-table"
  }
}

./module/vpc/main.tf.code:
resource "aws_vpc" "main" {
  cidr_block           = var.cidr_block
  enable_dns_hostnames = true
  enable_dns_support   = true

  tags = {
    Name = "Cloud-AI-VPC"
  }
}

resource "aws_subnet" "public" {
  count                   = length(var.public_subnets_cidr)
  vpc_id                  = aws_vpc.main.id
  cidr_block              = var.public_subnets_cidr[count.index]
  map_public_ip_on_launch = true
  availability_zone       = element(var.availability_zones, count.index)

  tags = {
    Name = "Cloud-AI-Public-${count.index}"
  }
}

resource "aws_internet_gateway" "gw" {
  vpc_id = aws_vpc.main.id

  tags = {
    Name = "Cloud-AI-Internet-Gateway"
  }
}

resource "aws_route_table" "public" {
  vpc_id = aws_vpc.main.id

  route {
    cidr_block = "0.0.0.0/0"
    gateway_id = aws_internet_gateway.gw.id
  }

  tags = {
    Name = "Cloud-AI-Public-Route-Table"
  }
}

resource "aws_route_table_association" "public" {
  count          = length(var.public_subnets_cidr)
  subnet_id      = element(aws_subnet.public[*].id, count.index)
  route_table_id = aws_route_table.public.id
}

./module/vpc/variables.tf.code:
variable "cidr_block" {
  description = "The CIDR block for the VPC."
  type        = string
}

variable "public_subnets_cidr" {
  description = "A list of public subnet CIDRs."
  type        = list(string)
}

variable "availability_zones" {
  description = "A list of availability zones in the region"
  type        = list(string)
}

./module/vpc/outputs.tf.code:
output "vpc_id" {
  description = "The ID of the VPC."
  value       = aws_vpc.main.id
}

output "public_subnets" {
  description = "The IDs of the public subnets."
  value       = aws_subnet.public[*].id
}

output "internet_gateway" {
  description = "The ID of the internet gateway."
  value       = aws_internet_gateway.gw.id
}

./module/ec2/main.tf.code:
resource "aws_launch_configuration" "app" {
  name_prefix          = "cloud-ai-launch-configuration-"
  image_id             = var.ami_id
  instance_type        = var.instance_type
  security_groups      = [aws_security_group.app_sg.id]
  user_data            = file("${path.module}/user_data.sh")
  lifecycle {
    create_before_destroy = true
  }
}

resource "aws_autoscaling_group" "app_asg" {
  launch_configuration    = aws_launch_configuration.app.id
  vpc_zone_identifier     = var.public_subnets
  min_size                = var.asg_min_size
  max_size                = var.asg_max_size
  desired_capacity        = var.asg_desired_capacity
  health_check_type       = "EC2"
  force_delete            = true
  wait_for_capacity_timeout = "0"

  tag {
    key                 = "Name"
    value               = "cloud-ai-asg-instance"
    propagate_at_launch = true
  }
}

resource "aws_security_group" "app_sg" {
  name_prefix = "cloud-ai-app-sg-"
  vpc_id      = var.vpc_id

  ingress {
    from_port   = 80
    to_port     = 80
    protocol    = "tcp"
    cidr_blocks = ["0.0.0.0/0"]
  }

  egress {
    from_port   = 0
    to_port     = 0
    protocol    = "-1"
    cidr_blocks = ["0.0.0.0/0"]
  }
}

resource "aws_alb" "app_alb" {
  name               = "cloud-ai-app-alb"
  subnets            = var.public_subnets
  security_groups    = [aws_security_group.app_sg.id]

  tags = {
    Name = "cloud-ai-app-load-balancer"
  }
}

resource "aws_alb_target_group" "app_tg" {
  name        = "cloud-ai-app-tg"
  port        = 80
  protocol    = "HTTP"
  vpc_id      = var.vpc_id

  health_check {
    path               = "/"
    interval           = 30
    timeout            = 5
    healthy_threshold   = 2
    unhealthy_threshold = 2
  }
}

resource "aws_alb_listener" "front_end" {
  load_balancer_arn = aws_alb.app_alb.id
  port              = "80"
  protocol          = "HTTP"

  default_action {
    type             = "forward"
    target_group_arn = aws_alb_target_group.app_tg.arn
  }
}

./module/ec2/user_data.sh.code:
#!/bin/bash
echo "Auto Deployment from Cloud-AI" > index.html
nohup busybox httpd -f -p 80 &

./module/ec2/variables.tf.code:
variable "ami_id" {
  description = "The AMI ID for the EC2 instances."
  type        = string
}

variable "instance_type" {
  description = "The instance type of the EC2 instance."
  type        = string
}

variable "vpc_id" {
  description = "The ID of the VPC."
  type        = string
}

variable "public_subnets" {
  description = "A list of public subnet IDs."
  type        = list(string)
}

variable "asg_min_size" {
  description = "Minimum size of the Auto Scaling Group."
  type        = number
}

variable "asg_max_size" {
  description = "Maximum size of the Auto Scaling Group."
  type        = number
}

variable "asg_desired_capacity" {
  description = "Desired capacity of the Auto Scaling Group."
  type        = number
}

./module/ec2/outputs.tf.code:
output "alb_dns_name" {
  description = "The DNS name of the application load balancer."
  value       = aws_alb.app_alb.dns_name
}
